import React from 'react';

class ClickMe extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            return (
                <div id="clickThis">
                    <div id="words">
                        Click one of the options below to find out more!    
                    </div>

                    <style jsx>
                        {`

                        #clickThis {
                            height: 50px;
                            width: 100%;
                            color: white
                            
                        }

                        #words {
                            transform: translate(0, 5px)
                        }
                        
                        `}
                    </style>
                </div>
            )
        }
    }

export default ClickMe;
